import React from "react";
import { Card } from "react-bootstrap";

const Cards = () => {
  return (
    <div>
      <div className="cards">
        <div className="row">
          <div className="col-lg-3">
            <Card>
              <Card.Body>
                <div className="cards">
                  <i class="bi bi-bar-chart-fill"></i>
                </div>
                <h2>714K</h2>
                <p>Total Data</p>
              </Card.Body>
            </Card>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Cards;
